
          
CREATE TABLE `erp_iiitk`.`courses` ( `CourseCode` VARCHAR(10) NOT NULL , `CourseName` VARCHAR(40) NOT NULL , `Credits` INT(3) , `Semester` VARCHAR(10) NOT NULL , `CourseInstructor` VARCHAR(30)) ENGINE = InnoDB;




        

CREATE TABLE `erp_iiitk`.`events` ( `Event Date` VARCHAR(20) NOT NULL , `Description` VARCHAR(50) NOT NULL , `Logo` BLOB NOT NULL ) ENGINE = InnoDB;




































